const initialState = {
	test: 'no persist',
};

const reducers = (state = initialState, action) => {
	switch (action.type) {
		case 'TEST': {
			return {
				...state,
				test: action.payload,
			}
		}
		default: {
			return state;
		}
	}
};
// Exports
export default reducers;
